SA_32_BUILT_PRODUCTS_DIR=\"${BASH_REMATCH[1]}iphoneos32\"\nelse\n    echo \"Could not find other platform build directory.\"\n    exit 1\nfi\n\n# Build the other platform.\n#32 bit\nbuild_static_library \"iphoneos${SA_SDK_VERSION}\" \\\n\"armv7 armv7s\" \\\ntrue \\\ntrue\n\ncp -R \"${SA_ROOT_BUILD_DIR}iphoneos\" \"${SA_32_BUILT_PRODUCTS_DIR}\"\n\n#64 bit\nbuild_static_library \"iphoneos${SA_SDK_VERSION}\" \\\n\"arm64 arm64e\" \\\nfalse \\\ntrue\n\n#x86 - simulator\nbuild_static_library \"iphonesimulator${SA_SDK_VERSION}\" \\\n\"i386 x86_64\" \\\nfalse \\\nfalse\n\n# Join the 3 static libs into 1 and push into the .framework\n\nmake_fat_library \"${BUILT_PRODUCTS_DIR}/${SA_INPUT_STATIC_LIB}\" \\\n\"${SA_OTHER_BUILT_PRODUCTS_DIR}/${SA_INPUT_STATIC_LIB}\" \\\n\"${SA_32_BUILT_PRODUCTS_DIR}/${SA_INPUT_STATIC_LIB}\" \\\n\"${BUILT_PRODUCTS_DIR}/${SA_INPUT_STATIC_LIB}\"\n\n# Ensure that the framework is present in both platform's build directories\ncp -a \"${BUILT_PRODUCTS_DIR}/${SA_INPUT_STATIC_LIB}\" \\\n\"${SA_OTHER_BUILT_PRODUCTS_DIR}/${SA_INPUT_STATIC_LIB}\"\n\n# Copy the framework to the user's desktop\nditto \"${SA_FRAMEWORK_LOCATION}\" \"${HOME}/Desktop/${SA_FRAMEWORK_NAME}.framework\"\n\nrm -r \"${SA_32_BUILT_PRODUCTS_DIR}\"\n";
